import logo from "./logo.svg";
import "./App.css";

function App() {
    const nombre = 'kervis'
    const empledo = {
        nombre : 'kervis',
        trabajo : 'desarrollador web'
    }
  return (
      <div className="rojo">
        <h1>aprendiendo react</h1>
        <p>mi primer componente { 2 + 2 } y su nombre es
            { empledo.nombre }
            trabaja
            {empledo.trabajo}
        </p>
      </div>
  );
}

export default App;
